import React, { useState } from 'react';
import { Button, Card, Table, Form } from 'react-bootstrap';

// Dummy data for demonstration
const dummyReports = [
  { id: 1, type: 'Deposit', date: '2024-06-01', user: 'john', amount: 1000 },
  { id: 2, type: 'Withdrawal', date: '2024-06-02', user: 'jane', amount: 500 },
  { id: 3, type: 'Commission', date: '2024-06-03', user: 'admin', amount: 200 },
];

const reportTypes = [
  { value: '', label: 'All Types' },
  { value: 'Deposit', label: 'Deposit' },
  { value: 'Withdrawal', label: 'Withdrawal' },
  { value: 'Commission', label: 'Commission' },
];

function exportToCSV(data, filename) {
  const csvRows = [];
  const headers = Object.keys(data[0]);
  csvRows.push(headers.join(','));
  for (const row of data) {
    csvRows.push(headers.map(h => JSON.stringify(row[h] ?? '')).join(','));
  }
  const csvContent = csvRows.join('\n');
  const blob = new Blob([csvContent], { type: 'text/csv' });
  const url = window.URL.createObjectURL(blob);
  const a = document.createElement('a');
  a.setAttribute('hidden', '');
  a.setAttribute('href', url);
  a.setAttribute('download', filename);
  document.body.appendChild(a);
  a.click();
  document.body.removeChild(a);
}

const Reports = () => {
  const [filters, setFilters] = useState({
    type: '',
    startDate: '',
    endDate: '',
  });
  const [reports, setReports] = useState(dummyReports);

  // Filter logic (client-side for demo)
  const filteredReports = reports.filter(r => {
    const matchesType = !filters.type || r.type === filters.type;
    const matchesStart = !filters.startDate || r.date >= filters.startDate;
    const matchesEnd = !filters.endDate || r.date <= filters.endDate;
    return matchesType && matchesStart && matchesEnd;
  });

  const handleChange = (e) => {
    setFilters({ ...filters, [e.target.name]: e.target.value });
  };

  const handleDownload = () => {
    if (filteredReports.length === 0) return;
    exportToCSV(filteredReports, 'report.csv');
  };

  return (
    <div className="container mt-4">
      <Card>
        <Card.Body>
          <Card.Title>Reports</Card.Title>
          <Form className="row g-3 mb-3">
            <div className="col-md-3">
              <Form.Label>Type</Form.Label>
              <Form.Select name="type" value={filters.type} onChange={handleChange}>
                {reportTypes.map(rt => (
                  <option key={rt.value} value={rt.value}>{rt.label}</option>
                ))}
              </Form.Select>
            </div>
            <div className="col-md-3">
              <Form.Label>Start Date</Form.Label>
              <Form.Control type="date" name="startDate" value={filters.startDate} onChange={handleChange} />
            </div>
            <div className="col-md-3">
              <Form.Label>End Date</Form.Label>
              <Form.Control type="date" name="endDate" value={filters.endDate} onChange={handleChange} />
            </div>
            <div className="col-md-3 d-flex align-items-end">
              <Button variant="primary" className="me-2" onClick={handleDownload} disabled={filteredReports.length === 0}>
                Download CSV
              </Button>
            </div>
          </Form>
          <Table striped bordered hover responsive>
            <thead>
              <tr>
                <th>ID</th>
                <th>Type</th>
                <th>Date</th>
                <th>User</th>
                <th>Amount</th>
              </tr>
            </thead>
            <tbody>
              {filteredReports.length === 0 ? (
                <tr><td colSpan="5" className="text-center">No reports found.</td></tr>
              ) : (
                filteredReports.map(r => (
                  <tr key={r.id}>
                    <td>{r.id}</td>
                    <td>{r.type}</td>
                    <td>{r.date}</td>
                    <td>{r.user}</td>
                    <td>{r.amount}</td>
                  </tr>
                ))
              )}
            </tbody>
          </Table>
        </Card.Body>
      </Card>
    </div>
  );
};

export default Reports;
